import styled from "styled-components"
import Navbar from '../components/Navbar'
import Annoucement from '../components/Annoucement'


const Container = styled.div``
const ProductList = () => {
  return (
    <Container>
        <Annoucement/>
        <Navbar/>
    </Container>
  )
}

export default ProductList
